import React, { Component } from 'react';
import './../css/App.css';

class App extends Component {

  constructor () {
    super();

    this.appTitle = "OurRhyme";
  }

  init () {
    if(document.getElementById('appHeader') != null){
      this.appHeader = document.getElementById('appHeader');
    }
    else {
      console.log("É nulo");
      setTimeout(() => { this.init(); }, 500);
    }
  }

  render() {
    return (
      <div className="App">
        <header id="appHeader">
          <div id="auth">
            <h1 id="appTitle">{ this.appTitle }</h1>
          </div>
        </header>
        { this.init() }
      </div>
    );
  }
}

export default App;
